import BlogList from './BlogList';
import useFetch from './usefetch';

const Home = () => {
    const {data: blogs, isPending, error} = useFetch('https://localhost:8000/blogs');

    return (
        <div className="home">
            {error && <div>{error}</div>}
            {isPending && <div>Loading...</div>}
            <BlogList blog={blogs} title="All Blogs"/>
        </div>
    );
}

export default Home;
